ScukMap.model.SimpleDataProxy = function () {

	this.dataCache = new ScukMap.model.DataCache();

}

ScukMap.model.SimpleDataProxy.prototype	= {

	init: function() {

		this.dataCache.init();

	},

	/**
	*	ziskava data pro novy bounding box ( filtry )
	*	@callback - uspesny callback
	*	@type - type, pro kterou ziskat data
	*/
	getData: function( callback, type, tiles ) {
		
		//parse data pro kategorii category
		var self = this;
		var data = null;
		
		//verze s jednoduchym
		if( type != 0 ) {

			//potreba najit specificka data
			var len = dummyData.length;
			data = [];
			//projet vsechny markery, jestli je ten co hledame
			for( var i = 0; i < len; i++ ) {

				var markerData = dummyData[ i ];
				var markerTypes = ScukMap.utils.DataUtil.parseMarkerType( markerData.type );
				
				//je marker typu, ktery potrebujeme
				var isCorrectType = $.inArray( type, markerTypes );
				if( isCorrectType > -1 ) {
					//spravny marker, pridat na poslani
					data.push( markerData );
				}
			}

		} else {

			data = dummyData;

		}
		
		callback.apply( this, [ data ] );
	}
}
